import React from "react";

function ToDoList(props) {
  return (
    <>
      <div>
        <li key={props.index}>
          {props.itemval}
          <button
            onClick={() => {
              props.onSelect(props.id);
            }}
          >
            delete
          </button>
        </li>
      </div>
    </>
  );
}

export default ToDoList;
